import './App.css';
import Header from './components/Header/Header';
import {BrowserRouter, Switch, Route} from 'react-router-dom'
import AboutUs from './components/AboutUs/AboutUs';

function App() {
  return (
    <BrowserRouter>
      <Header />
      <Switch>
        <Route path='/about-us'>
          <AboutUs />
        </Route>
      </Switch>
    </BrowserRouter>
  );
}

export default App;
